import React, { Component } from "react";

class Login extends Component {
    constructor(props) {
        super(props);    
        this.state = {
          username: "",
          password: ""
        };
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(event) {
        event.preventDefault();
    }
    render() {
        return(
            <>
                <h1>Test</h1>
            </>
        );
    }
}

export default Login;
